import React, {Component} from 'react';
import APIService from "../APIService";

class SignUp extends Component {
    constructor(props) {
        super(props);

        this.state = {
            customer_username: '',
            customer_password_1: '',
            customer_password_2: '',
            customer_email: '',
            customer_phone: '',
            customer_gender: 'f',
            customer_date_of_birth: ''
        }
    }
    customer_username_handler = (event) => {
        this.setState({
            customer_username: event.target.value
        })
    }

    customer_password_1_handler = (event) => {
        this.setState({
            customer_password_1: event.target.value
        })
    }

    customer_password_2_handler = (event) => {
        this.setState({
            customer_password_2: event.target.value
        })
    }

    customer_phone_handler = (event) => {
        this.setState({
            customer_phone: event.target.value
        })
    }

    customer_gender_handler = (event) => {
        this.setState({
            customer_gender: event.target.value
        })
    }

    customer_date_of_birth_handler = (event) => {
        this.setState({
            customer_date_of_birth: event.target.value
        })
    }

    render() {
        const submit_form = () => {
            APIService.sign_up({
                "customer_username": "2",
                "customer_password": this.state.apt_area,
                "customer_email": this.state.question,
                "customer_phone": "0",
                "customer_gender": new Date().toISOString().slice(0, 19),
                "customer_date_of_birth": "2"})
                .then(resp => console.log(resp))
        }
        return (
            <div className="form">
                <input type="text" value={this.state.customer_username} placeholder="enter your username"
                       className="form-control" onChange={this.customer_username_handler}/>
                <input type="text" value={this.state.customer_password} placeholder="enter your password"
                       className="form-control" onChange={this.customer_password_1_handler}/>
                <input type="text" value={this.state.customer_password} placeholder="repeat your password"
                       className="form-control" onChange={this.customer_password_2_handler}/>
                <input type="text" value={this.state.customer_email} placeholder="enter your email"
                       className="form-control" onChange={this.customer_email_handler}/>
                <input type="text" value={this.state.customer_password} placeholder="enter your password"
                       className="form-control" onChange={this.customer_password_handler}/>

                <label htmlFor="apartment area">where is your interested apartment:</label>

                <select name="apt_area" id="apt_area" onChange={this.apt_area_handler}>
                    <option value="0">College Station</option>
                    <option value="1">Austin</option>
                    <option value="2">Houston</option>
                </select>
                <br/><br/>
                <input type="text" value={this.state.question} placeholder="enter your question"
                       className="form-control" onChange={this.question_content_handler}/>

                <button className="btn btn-primary" onClick={submit_form}>Submit</button>

            </div>

        );
    }
}

export default SignUp;
